package ThirtyDaysOfCode

import Infrastructure.HackersHelper.{Console, StdIn}
import org.scalatest.FunSuite

class Day6_Lets_Review extends FunSuite {

  object Solution {

    //import scala.io.StdIn

    def isEven(number: Int) = number % 2 == 0

    def isOdd(number: Int) = !isEven(number)

    def main(args: Array[String]) {

      val T = StdIn.readInt()

      if (T >= 1 && T <= 10) {
        for (i <- 1 to T) {
          val S = StdIn.readLine()

          if (S.length <= 10000 && S.length >= 2) {
            val odds = new StringBuilder
            val evens = new StringBuilder
            for (k <- 0 until S.length) {
              k match {
                case k if k == 0 | isEven(k) => evens.append(S.charAt(k))
                case k if isOdd(k) => odds.append(S.charAt(k))
              }
            }

            Console.println(evens.toString() + " " + odds.toString())
          }
        }
      }
    }
  }

  test("Run solution") {

    // Injecting input data from HackerRank challenge
    val inputData = List(
      "2",
      "Hacker",
      "Rank"
    )
    StdIn.setInputData(inputData)

    // Injecting output data from HackerRank challenge
    val outputData = List(
      "Hce akr",
      "Rn ak"
    )
    Console.setOutputData(outputData)

    // Running challenge
    Solution.main(null)
  }

  test("Run test case 7") {

